import React from "react";
import styled from "styled-components";

const SelectButton = () => {
  return (
    <React.Fragment>
      <Div>
        <Button>강남구</Button>
        <Button>강북구</Button>
        <Button>노원구</Button>
        <Button>동대문구</Button>
        <Button>동작구</Button>
        <Button>마포구</Button>
        <Button>송파구</Button>
        <Button>용산구</Button>
      </Div>
    </React.Fragment>
  );
};

export default SelectButton;

const Div = styled.div`
  width: 980px;
  margin: 0px auto;
  display: flex;
  flex-direction: row;
  justify-content: space-around;
`;

const Button = styled.button`
  width: 100px;
  height: 40px;
  border-right: 1px solid;
`;
